import React from 'react';
import { Typography, Box, List, ListItem, ListItemText } from '@mui/material';

const Projects = () => {
  return (
    <Box id="projects" sx={{ p: 2 }}>
      <Typography variant="h4" gutterBottom>Projects</Typography>
      <List>
        <ListItem>
          <ListItemText primary="Project 1" secondary="Brief description" />
        </ListItem>
        <ListItem>
          <ListItemText primary="Project 2" secondary="Brief description" />
        </ListItem>
        {/* Add more projects as needed */}
      </List>
    </Box>
  );
};

export default Projects;
